/****** Object:  StoredProcedure [dbo].[GETATTRITIONFACTORSWITHDATA]    Script Date: 07-03-2019 21:13:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[GETATTRITIONFACTORSWITHDATA]
AS
BEGIN
	SELECT 
		 [Account]
		,[DistanceFromHome]
		,[EmployeeNumber]
		,[EnvironmentSatisfaction]
		,[JobInvolvement]
		,[JobSatisfaction]
		,[MonthlyIncome]
		,[NumCompaniesWorked]
		,[PercentSalaryHike]
		,[RelationshipSatisfaction]
		,[TrainingTimesLastYear]
		,[WorkLifeBalance]
		,[YearsAtCompany]
		,[YearsInCurrentRole]
		,[YearsSinceLastPromotion]
		,[YearsWithCurrManager]
		,[Scored Labels] AS Attrition
		,CEILING(CAST([Scored Probabilities] AS FLOAT) * 100) AS AttritionProbabilities
	FROM [dbo].[MasterDataSet]
	WHERE [Scored Labels] = 'Yes'
END


GO
/****** Object:  StoredProcedure [dbo].[GETDASHBORDDATA]    Script Date: 07-03-2019 21:13:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[GETDASHBORDDATA] 
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

	DECLARE @TotalYesCount FLOAT, @TotalLessLikelyYesCount FLOAT, @TotalLikelyYesCount FLOAT, @TotalMostLikelyYesCount FLOAT;
	SELECT @TotalYesCount = COUNT(ID) FROM MASTERDATASET WHERE [Scored Labels] = 'Yes';
	SELECT @TotalLessLikelyYesCount = COUNT(ID) FROM MASTERDATASET 
		WHERE [Scored Labels] = 'Yes' AND [Scored Probabilities] BETWEEN '0.5' AND '0.6';
	SELECT @TotalLikelyYesCount = COUNT(ID) FROM MASTERDATASET 
		WHERE [Scored Labels] = 'Yes' AND [Scored Probabilities] BETWEEN '0.6' AND '0.8';
	SELECT @TotalMostLikelyYesCount = COUNT(ID) FROM MASTERDATASET 
		WHERE [Scored Labels] = 'Yes' AND [Scored Probabilities] >= '0.8';
    -- FOR MAIN DASHBORD TAB IN WEBSITE
	WITH CTE
	AS
	(
		SELECT
			RANGE50TO60 = CEILING(@TotalLessLikelyYesCount/@TotalYesCount * 100),
			RANGE60TO80 = CEILING(@TotalLikelyYesCount/@TotalYesCount * 100) ,
			RANGE80TO100 = CEILING(@TotalMostLikelyYesCount/@TotalYesCount * 100)
	)

	SELECT RANGE50TO60,100-(RANGE50TO60 + RANGE80TO100) RANGE60TO80,RANGE80TO100 FROM CTE;
 
	DECLARE @TotalScoreAvg FLOAT, @TotalYesScoreAvg FLOAT;
	SELECT @TotalScoreAvg = COUNT(ID) FROM MASTERDATASET
	SELECT @TotalYesScoreAvg = COUNT(ID) FROM MASTERDATASET WHERE [Scored Labels] = 'Yes'
	SELECT CEILING(@TotalYesScoreAvg/@TotalScoreAvg * 100) AS OVERALLATTRITIONSCORE;
 		 
	WITH CTE1
	AS
	(
		SELECT 
			LOCATION,CAST(COUNT(ID) AS FLOAT) AS TOTALATTRITIONSCORE
		FROM 
			MASTERDATASET
		GROUP BY 
			LOCATION
	),
	CTE2
	AS
	(
		SELECT 
			LOCATION,CAST(COUNT(ID) AS FLOAT) AS TOTALYESATTRITIONSCORE,
			CEILING(AVG(SENTIMENTSCORE)) LOCSENTIMENTSCORE
		FROM 
			MASTERDATASET
		WHERE [SCORED LABELS] = 'YES'
		GROUP BY 
			LOCATION
	)
	SELECT 
		T2.LOCATION
		,CEILING(T1.TOTALYESATTRITIONSCORE / T2.TOTALATTRITIONSCORE * 100) AS LOCLATTRITIONSCORE
		,T1.LOCSENTIMENTSCORE
	FROM 
		CTE2 T1
		INNER JOIN CTE1 T2 ON T1.LOCATION = T2.LOCATION

	SELECT
		 ENVIRONMENTSATISFACTION,
		 JOBINVOLVEMENT,
		 JOBSATISFACTION,
		 RELATIONSHIPSATISFACTION,
		 WORKLIFEBALANCE,
		 DISTANCEFROMHOME,
		 MONTHLYINCOME
	FROM
		[DBO].[MASTERDATASET]
	WHERE [Scored Labels] = 'YES'
	

	SELECT CEILING(AVG(SENTIMENTSCORE)) SENTIMENTSCORE FROM MASTERDATASET GROUP BY ORGANISATION;

	WITH SURVEYPARTICIPATIONCTE
	AS
	(
		SELECT ISSURVEYFILLED,CEILING(100. * COUNT(ID) / SUM(COUNT(ID)) OVER ()) AS SurveyParticipation
		FROM MASTERDATASET
		GROUP BY ISSURVEYFILLED
	)
	SELECT SurveyParticipation FROM SURVEYPARTICIPATIONCTE WHERE ISSURVEYFILLED = 1

END
GO
