CREATE PROCEDURE [dbo].[GETMORALECHECKDATA]
AS
BEGIN
	SELECT 
		[KeyPhrases]
	 FROM 
	  [dbo].[MasterDataSet]
	WHERE
	  [KeyPhrases] IS NOT NULL

	  SELECT 
		 [Account]
		,CEILING(AVG(SENTIMENTSCORE)) AS SENTIMENTSCORE
	 FROM 
		[dbo].[MasterDataSet]
	 GROUP BY
		[Account]

	 SELECT 
		 [Location]
		,[Scored Labels] AS Attrition
		,COUNT([Scored Labels]) AS AttritionCount
	 FROM 
		[dbo].[MasterDataSet]
	 GROUP BY 
		[Location]
		,[Scored Labels]
END

	


