/****** Object:  StoredProcedure [dbo].[GETSEGMENTSDATA]    Script Date: 07-03-2019 21:13:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[GETSEGMENTSDATA] 
AS
BEGIN
SET NOCOUNT ON;

---- FOR SEGMENT TAB IN WEBSITE
	WITH CTE1
	AS
	(
		SELECT 
			ACCOUNT,CAST(COUNT(ID) AS FLOAT) AS TOTALATTRITIONSCORE
		FROM 
			MASTERDATASET
		GROUP BY 
			ACCOUNT
	),
	CTE2
	AS
	(
		SELECT 
			ACCOUNT,CAST(COUNT(ID) AS FLOAT) AS TOTALYESATTRITIONSCORE
		FROM 
			MASTERDATASET
		WHERE [SCORED LABELS] = 'YES'
		GROUP BY 
			ACCOUNT
	)
	SELECT 
		T2.ACCOUNT,CEILING(T1.TOTALYESATTRITIONSCORE/T2.TOTALATTRITIONSCORE * 100) AS ATTRITIONSCORE
	FROM 
		CTE2 T1
		INNER JOIN CTE1 T2 ON T1.ACCOUNT = T2.ACCOUNT
	
	SELECT
		ENVIRONMENTSATISFACTION,
		JOBINVOLVEMENT,
		JOBSATISFACTION,
		RELATIONSHIPSATISFACTION,
		WORKLIFEBALANCE,
		DISTANCEFROMHOME,
		MONTHLYINCOME,
		ACCOUNT
	FROM MASTERDATASET
	WHERE [SCORED LABELS] = 'YES'
	GROUP BY 
		ACCOUNT,
		ENVIRONMENTSATISFACTION,
		JOBINVOLVEMENT,
		JOBSATISFACTION,
		RELATIONSHIPSATISFACTION,
		WORKLIFEBALANCE,
		DISTANCEFROMHOME,
		MONTHLYINCOME


END
